import axios from "axios";
const KEY = "AIzaSyCQBnQ5y5qBGGNbzOvyw5GSydItU6oGkbU";

export default axios.create({
  baseURL: "https://www.googleapis.com/youtube/v3/",
  params: {
    part: "snippet",
    maxResult: 5,
    key: KEY,
  },
});
